import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import NavbarToolbox from './components/NavbarToolbox'
import { useDimensions } from 'react-dimensions-hook';



function App() {

  const { dimensions } = useDimensions();

  return (
    <div className="App">
      <div style={{height: dimensions.width, backgroundColor: 'yellow'}}>
        <NavbarToolbox/>
      </div>
    </div>
  );
}

export default App;
